    <title lang="en">Brick Slaves</title>
    <desc lang="en">LAU YIU-MING (Vincent Wong) exhausts the money that he and his girlfriend have saved for many years to buy a property and is about to get married. Out of the blue, his girlfriend not only wants to break up with him, but also secretly leases the premises out to a piano teacher, CHOI KIN-CHING (Selena Li). Unfortunately, YIU-MING's bad day gets even worse as he is soon laid off from work. In order to continue to pay the mortgage, YIU-MING has no other choice but to accept the unreasonable condition imposed by KIN-CHING, however the two often have arguments due to their differences in lifestyles. Later on, YIU-MING unveils that there is quite a story behind KIN-CHING's personality that makes everyone keep a distance from her. Eventually, YIU-MING finds a new job with a property management company. Unknown to him, his arrival ruins LO PIT-TAT's (Mak Cheung Ching) hope of getting promoted, so PIT-TAT, a third-generation brick slave, for the sake of keeping his own job becomes completely incompatible with YIU-MING at work. Nevertheless, YIU-MING gains recognition from his boss, LI OI-WAH (Sheung Tin Ngor), who even urges him to specifically look after a trainee called CHUK PIK-KEI (Eliza Sam). Due to their work, YIU-MING and PIK-KEI get to observe the world around the brick slaves. PIK-KEI gradually falls in love with YIU-MING, yet YIU-MING knows very well whom he really loves. All of a sudden, KIN-CHING requests to end the tenancy......</desc>
